import "./App.css";

<link
  type="text/css"
  rel="stylesheet"
  href="css/materialize.min.css"
  media="screen,projection"
/>;
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
